import React from 'react';
import '../styles/about.css';

function About() {
  return (
    <div className="about">
      <h1>Sobre Nosotros</h1>
      <p>Somos una agencia en Buenos Aires especializada en sitios web.</p>
    </div>
  );
}

export default About;
